function monitorCheckPrintbutton() {
    if ($('[id="printCheckButton"]').length > 1)
        $('[id="printCheckButton"]').parent().remove();
    if ($("#printCheckButton").length == 0)
        placeCheckPrintButton();
    else
        setTimeout(monitorCheckPrintbutton,1000);
}

function placeCheckPrintButton() {
    if ( $("#report_div .d-print-none").length == 2 ) {
        var load = `
        <div style='margin-top:10px;'>
            <button id="printCheckButton" class="report_btn jqbuttonmed ui-button ui-corner-all ui-widget" style="font-size:12px;">
                <i class="fas fa-print fs10"></i> Print Checks
            </button>
        </div>`;
        $("#report_div .d-print-none").last().append(load);
        monitorCheckPrintbutton();
        $("#printCheckButton").on('click', printChecks);
        $("#printCheckButton").on("remove", function () {
            window.requestAnimationFrame(buildPrintButton);
        })
    }
    else {
        if ($('#report_load_progress2').is(":visible") || $('#report_load_progress').is(":visible"))
            setTimeout(placeCheckPrintButton,1000)
        else
            window.requestAnimationFrame(placeCheckPrintButton);
    }
}

function printChecks() {
    // Load in once
    const study = CTRItweaks.Check.study;
    const study_addr = CTRItweaks.Check.address.split('\\');
    const header = $("#report_table thead tr").length;
    
    // Cal Index to pull from on report
    const payto_index = $("#report_table th:contains('"+CTRItweaks.Check.varName+"')").index();
    const cash_index = $("#report_table th:contains('"+CTRItweaks.Check.varAmt+"')").index();
    const memo_index = $("#report_table th:contains('"+CTRItweaks.Check.varMemo+"')").index();
    const addr1_index = $("#report_table th:contains('"+CTRItweaks.Check.varAddr1+"')").index();
    const addr2_index = $("#report_table th:contains('"+CTRItweaks.Check.varAddr2+"')").index();
    const addr3_index = $("#report_table th:contains('"+CTRItweaks.Check.varAddr3+"')").index();
                  
    let master = makeWrapperPrintObject();
    let subject;
    let cash;
    let memo;
    const max = $("#report_table tr:visible").slice(header).length;
    $("#report_table tr:visible").slice(header).each( function( index, el ) {
        cash = $($(el).find('td')[cash_index]).text();
        subject = $($(el).find('td')[payto_index]).text();
        memo = $($(el).find('td')[memo_index]).text();
        addr = [$($(el).find('td')[addr1_index]).text(),$($(el).find('td')[addr2_index]).text(),$($(el).find('td')[addr3_index]).text()];
        master.content.push( ...makePrintObject(subject, study, memo, cash, addr, study_addr) );
        if ( index!=max-1 )
            master.content.push( {pageBreak:'after',text:''} );
    });
    
    try {
        pdfMake.createPdf(master).open();
    }
    catch {
        console.log("Font not yet loaded, please wait a second.")
    }
    
}

function loadVFS() {
    if (typeof window.pdfMake == 'undefined') {
        setTimeout(loadVFS, 2000);
        return;
    }
    if (typeof window.pdfMake.vfs !== 'undefined') {
        console.log("Priting font loaded for checks")
        return;
    }
    addScript('https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.60/vfs_fonts.js');
    console.log('Attemting to load font for check priting');
    setTimeout(loadVFS, 3000);
}

$(document).ready(function(){
    addScript('https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.60/pdfmake.min.js');
    loadVFS();
    placeCheckPrintButton();
});